public class ValidPalindromeII {
    //https://leetcode.com/problems/valid-palindrome-ii/


    public static void main(String[] args) {
        System.out.println(new ValidPalindromeII().validPalindrome(""));
    }


    public boolean validPalindrome(String s) {
        return isPalindromeSubstring(s, false);
    }


    private boolean isPalindromeSubstring(String s, boolean passUsed) {
        int i = 0;
        int j = s.length() - 1;

        while (i < j) {
            if (s.charAt(i) != s.charAt(j)) {
                if (!passUsed) {
                    if (s.charAt(i+1) == s.charAt(j) || s.charAt(i) == s.charAt(j-1)) {
                       return isPalindromeSubstring(s.substring(0, i) + s.substring(i+1), true) || isPalindromeSubstring(s.substring(0, j) + s.substring(j+1), true);
                    } else {
                        return false;
                    }
                } else {
                    return false;
                }
            }
            i++;
            j--;
        }

        return true;

    }
}
